    "minute_pie <- ggplot(minute, aes(x = \"\", y = Minutes, fill = MinutesType)) +\n",
    "  geom_bar(stat = \"identity\", width = 1) +\n",
    "  coord_polar(\"y\") +\n",
    "  theme_void() +\n",
    "  scale_fill_manual(\n",
    "    values = c(\n",
