    "      \"LightlyActiveMinutes\" = \"#35b779\",\n",
    "      \"SedentaryMinutes\" = \"#fde725\"\n",
    "    )\n",
    "  ) +\n",
    "labs(title = \"Minute Type Percentage\") +\n",
    "  theme(legend.position = \"right\", plot.title = element_text(vjust = 11, hjust = 0.03, size = 15),  legend.text = element_text(size = 9)) \n",
    " \n",
    "minute_pie\n"
   ]
